%[text] %[text:anchor:T_965E90EB] # **Polar Chart Examples**
%[text] **Overview**
%[text] The Polar`Chart` compares two line plots of cyclic data arranged around a circular (polar) axes. The chart data comprises:
%[text] - `AngularData` - an increasing numeric vector representing the independent variable.
%[text] - `RadialData` - a two-column matrix of data, each column of which is plotted against the `AngularData` around the circle. \
%[text] ![PolarChart.png](text:image:9fa7)
%[text] 
%[text] **Documentation**
%[text] - [`polaraxes`](<matlab: doc("polaraxes")>): create a polar axes
%[text] - [`polarplot`](<matlab: doc("polarplot")>): plot a line in polar coordinates \
%[text:tableOfContents]{"heading":"Table of Contents"}
%[text] 
%%
%[text] %[text:anchor:H_CAF93DFB] ## Create sample chart data.
%[text] The angular data comprises the months of the year, and the radial data are the average monthly temperatures for two locations (Cambridge and Glasgow).
months = 1:12;
meanMonthlyTemps = [4, 5, 6, 9, 12, 16, 17, 18, 15, 11, 7, 4;
    3, 4, 6, 8, 11, 13, 15, 15, 13, 10, 6, 4].';
%%
%[text] %[text:anchor:H_B7A0690C] ## Create a figure for the chart.
f = exampleFigure( "Name", "PolarChart Example" ); %[output:8feddd55]
%%
%[text] %[text:anchor:H_86E3DF4F] ## Create the chart, specifying the parent and input data.
PC = PolarChart( "Parent", f, ...     %[output:group:134801db] %[output:8feddd55]
    "AngularData", months, ... %[output:8feddd55]
    "RadialData", meanMonthlyTemps ); %[output:group:134801db] %[output:8feddd55]
%%
%[text] %[text:anchor:H_3B2B22B8] ## Annotate the chart.
%[text] Create and format the title.
title( PC, "Mean Monthly Temperatures", "FontSize", 14 ) %[output:49198fd9]
%[text] Define and customize the legend entries.
legend( PC, ["Cambridge", "Glasgow"], ... %[output:49198fd9]
    "FontSize", 12, ... %[output:49198fd9]
    "Location", "northeastoutside" ) %[output:49198fd9]
%[text] Customize the angular tick labels.
monthNames = month( datetime( 2000, 1:12, 1 ), "shortname" );
thetaticklabels( PC, monthNames ) %[output:49198fd9]
%[text] Customize the radial tick labels.
rticklabels( PC, rticklabels( PC ) + (char( 176 ) + "C") ) %[output:49198fd9]
%%
%[text] %[text:anchor:H_5A5EBF5D] ## Customize the chart appearance.
PC.MarkerSize = 25; %[output:9216a7e3]
PC.LineWidth = 2; %[output:9216a7e3]
%%
%[text] %[text:anchor:H_3D76AA31] ## Change the underlying chart data.
%[text] First, compute the mean temperature in each quarter.
meanQuarterlyTemps = mean( reshape( meanMonthlyTemps, 3, [] ) );
meanQuarterlyTemps = reshape( meanQuarterlyTemps, [], 2 );
%[text] Update the angular data.
PC.AngularData = 1:4; %[output:2bd80910]
%[text] Update the radial data.
PC.RadialData = meanQuarterlyTemps; %[output:2bd80910]
%[text] Update the annotations.
drawnow()
thetaticklabels( PC, "Q" + thetaticklabels( PC ) ) %[output:2bd80910]
title( PC, "Mean Quarterly Temperatures" ) %[output:2bd80910]
%%
